import React from 'react'
import PropTypes from 'prop-types'

const Header = (props) => {
    return (
        <div>
            <p>{props.title}</p>

        </div>
    )
}
Header.defaultPorps ={
    title :'new'
}
Header.PropTypes={
    title :PropTypes.string.isRequired
}

export default Header
